import React from "react";

function Note({onDelete, title, content}) {

  return (
    <div className="note">
      <h1>{title}</h1>
      <p>{content}</p>
      <button onClick ={() =>onDelete}>DELETE</button>
    </div>
  );
}

export default Note;
